import React from "react";
import axios from "axios";
import { faPen, faTrash } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

function Types() {
    const baseUrl = "http://localhost:8080";
    const [post, setPost] = React.useState([]);

    React.useEffect(() => {
        axios.get(baseUrl + "/type").then((response) => {
            setPost(response.data);
        });
    }, post);
    function check(string) {
        axios.delete(baseUrl + "/type/" + string);
        setTimeout(1000)
        alert("The type with ID " + string + " is being deleted.")
    }
    return post.map(function (row) {

        return (
            <tr>
                <th scope="row">{row.id}</th>
                <td>{row.name}</td>
                <td>{row.addedDate}</td>
                <td>{row.peremptionDate}</td>
                <td>{row.piecesNumber}</td>
                <td>{row.unitPrice}</td>
                <td>{row.unitQuantity}</td>*
                <td><FontAwesomeIcon icon={faPen} /></td>
                <td><FontAwesomeIcon icon={faTrash} onClick={() => { check(row.id) }} /></td>
            </tr>
        )
    }
    )
}
export default Types;
